var Logs={init:function(){Logs.connectWS(),Logs.more()},connectWS:function(){Logs.ws=new WebSocket(logsChannelURL),Logs.ws.onopen=function(){console.log("Connected to logs channel websocket.")},Logs.ws.onmessage=function(o){o=JSON.parse(o.data);"simple"===o.type&&Logs.appendLog(o.key1,o.key2,o.key3,o.data)},Logs.ws.onclose=function(){console.log("Disconnected to logs channel websocket.")},Logs.ws.onerror=function(o){console.log("ERROR",o)}},appendLog:function(o,n,e,s){var t='<div style="padding: 5px 0;font-size: 15px;">';t+='<span style="color: #696969">'+o+"</span> ",t+='<span style="color: #708090">'+n+"</span> ",t+='<span style="color: #6A5ACD">'+e+"</span> ",t+='<span style="color: #1E90FF">'+s+"</span> ",t+="</div>",$("#logsContent").prepend(t)},page:1,more:function(){$.ajax({url:Label.servePath+"/logs/more?page="+Logs.page,type:"GET",async:!1,success:function(n){if(0===n.code){let o=n.data;0===o.length?$("#loadMoreBtn").html("没有更多内容了"):o.forEach(o=>{Logs.appendLog(o.key1,o.key2,o.key3,o.data)})}}}),Logs.page++}};$(document).ready(function(){Logs.init()});